import React from 'react';
import './LandingPage.css';
import Footer from '../../Footer/Footer';
import Navbar from '../../Navbar/Navbar';

function LandingPage() {
  return (
    <div className="landingpage-container">
      <Navbar />
      <div className="content">
        <h1>COMPANY PROFILE</h1>
        <p>Ripple Planning Associates Ltd</p>
        <p>Registered offices:</p>
        <p>Suite 608, Vedic House,</p>
        <p>Mama Ngina Street,</p>
        <p>Nairobi, Kenya.</p>
        <p>Phone: +254 714 398 806</p>
        <p>Email: rippleassociatesltd@gmail.com</p>
        <p>Postal address:</p>
        <p>P.O. Box 1232-00100</p>
        <p>Nairobi, Kenya.</p>
        <p>EXPERTS IN URBAN PLANNING, ENVIRONMENTAL ASSESSMENT, MAPPING AND DEVELOPMENT RESEARCH</p>
      </div>
      <Footer />
    </div>
  );
}


export default LandingPage;
